    return (
        <div>
        <div className="expense-item_description">
        <h2>{props.location}</h2>
        <h2>{props.title}</h2>
        <div className="expense-item__price">Rs {props.amount}</div>
        </div>

        </div>
    );
}

export default ExpenseDetails;
